import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';

const handleDragStart = (e) => e.preventDefault();

const items = [
    <div>
        <h2>Shri ram associates</h2>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQDkUa-lNUPYIgQcXZQdT-jCoVQNZtmNAG648-VPeQ&usqp=CAU" onDragStart={handleDragStart} />
    </div>
    ,
    <img src="path-to-img" onDragStart={handleDragStart} />,
    <img src="path-to-img" onDragStart={handleDragStart} />,
  ];

const Clients = () => {
    return (
        <div>
            <h1>Hello</h1>
            <AliceCarousel autoPlay autoPlayInterval = {200} mouseTracking items={items} />
        </div>
    )
}

export default Clients
